import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { faker } from '@faker-js/faker';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './components/Register';
import ControlPanel from './components/Dashboard/ControlPanel';
import { SuperAdminProvider, useSuperAdmin } from './SuperAdminContext';
import './App.css';

const GenerateSuperAdminCredentials = () => {
  const { setSuperAdminCredentials } = useSuperAdmin();

  useEffect(() => {
    const generateSuperAdminCredentials = () => {
      const email = faker.internet.email();
      const password = faker.internet.password();
      setSuperAdminCredentials({ email, password });
      console.log(`SuperAdmin Email: ${email}, Password: ${password}`);
    };

    generateSuperAdminCredentials();
  }, [setSuperAdminCredentials]);

  return null;
};

const App = () => {
  return (
    <SuperAdminProvider>
      <Router>
        <GenerateSuperAdminCredentials />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/control-panel/*" element={<ControlPanel />} />
        </Routes>
      </Router>
    </SuperAdminProvider>
  );
};

export default App;
